import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import CreateArea from "./CreatArea";

const App = () => {

    
    return <div>
        <Header />
        <CreateArea />
        <Note/>
        <Footer />
    </div>
}

export default App;
